package lambdaTest;

public class CalcResult {
	    private int sum;
	    private int sub;
	    private int mul;
	    private double div;
	    
	    public CalcResult() {
			// TODO Auto-generated constructor stub
		}

		public CalcResult(int sum, int sub, int mul, double div) {
			this.sum = sum;
			this.sub = sub;
			this.mul = mul;
			this.div = div;
		}

		public int getSum() {
			return sum;
		}

		public void setSum(int sum) {
			this.sum = sum;
		}

		public int getSub() {
			return sub;
		}

		public void setSub(int sub) {
			this.sub = sub;
		}

		public int getMul() {
			return mul;
		}

		public void setMul(int mul) {
			this.mul = mul;
		}

		public double getDiv() {
			return div;
		}

		public void setDiv(double div) {
			this.div = div;
		}
	    
	    
		
}
